import "core-js/modules/es.array.push.js";
import HomeBody from './HomeBody.vue';
import HomeNav from './Reusables/HomeNav.vue';
export default {
  methods: {
    navClicked(opt) {
      if (opt == 'Order Now') {
        this.$router.push('/menu');
      } else if (opt == 'POS') {
        this.$router.push('/login');
      } else if (opt == 'Review') {
        this.$router.push('/ruv');
      } else {
        this.$router.push('/');
      }
    }
  },
  components: {
    HomeNav,
    HomeBody
  }
};
